import React,{useState} from 'react'

import './Nav.css'

export const Nav = ({allTitleVideo}) => {

    const [videoSelect,handleChangeSelect]=useState('')

    const handleSubmit=()=>{
        console.log(videoSelect);
    } 
    return (
        <header>
            <div className='start'>
                <i className="far fa-play-circle"></i>
                <h2>MyTube</h2>
            </div>

            <div className="center">
                <label htmlFor="video">chercher une video:</label>
                <input value={videoSelect} onChange={event => handleChangeSelect(event.target.value)} onClick={handleSubmit} type='text' list="video" id="search-video" name="video" /> 
        
                    <datalist id="video">   
                        {allTitleVideo}
                    </datalist>
            </div>
            <p>Connexion</p>

        </header>
    )
}


export default Nav
